import React, { useState } from 'react';
import MenuElement from './MenuElement.js';

import './LeftMenu.css';

const LeftMenu = () => {
  const [elements, setElements] = useState(<MenuElement onClick={() => alert("x")} val="Empty Element" src="placeholder.jpg" key="empty"/>);


  return (
    <div className="menu left">
      <div className="banner">
        Menu
      </div>
      <div className="elements">
        {elements}
      </div>
    </div>
  )
}

export default LeftMenu;
